import React from 'react';
import ActionWell from '../ActionWell';
import styles from './index.module.css';

const ProcedureStep = ({step, onDragStart, onDragEnd, onDragOver}) =>
  <ActionWell text={step.title} className={styles.container} draggable onDragStart={onDragStart} onDragOver={onDragOver} onDragEnd={onDragEnd} />

export default ProcedureStep;
